block":"app:BLOCK:400566ad-3f96-48a4-9a49-d0204fad254e","label":"删除","type":"default","hiddenExp":"row.componentType==='HELM' || row.componentType==='K8S_MICROSERVICE'"}]},"toolbar":{"docList":[],"actionList":[{"layout":"horizontal","displayType":"drawer","size":"large","icon":"","block":"app:BLOCK:a1b69620-9182-4d00-adc3-1ec6f0fb9477","label":"添加微服务组件","type":"default"},{"layout":"horizontal","displayType":"drawer","size":"large","icon":"build","block":"app:BLOCK:96c1fd7e-1516-4c4a-9691-ac62a438abc5","label":"添加组件","type":"primary"},{"layout":"horizontal","displayType":"drawer","size":"default","icon":"menu","block":"app:BLOCK:2d744043-f8c5-43d6-9074-ded7525fca7a","label":"应用全局变量管理","type":"default"}],"label":"操作","type":"button"},"dependParams":[],"size":"default","dataSourceMeta":{"method":"GET","api":"gateway/v2/foundation/appmanager/application-configurations/types","afterResponseHandler":"function afterResponse(respData){
  var components = [];
  var globalParameterValues = [];
  var traits = {};
  var optionValues = [];


  respData.items.forEach(function(row){
    if(row.typeId.startsWith("Type:components::")){
      components.push(row);
    }else if(row.typeId == "Type:parameterValues" && Array.isArray(row.configJson)){
      globalParameterValues = row.configJson;
    }else if(row.typeId.startsWith("Type:traits::")){
      component = row.typeId.replace("Type:traits::", "Type:components::").split("::Trait")[0];
      if(!traits[component]){
        traits[component] = [];
      }
      row.pluginName = row.typeId.split("::Trait:")[1];
      traits[component].push(row);
    }

  });

  globalParameterValues.forEach(function(row){
  	optionValues.push({
  		"value": row.name,
  		"label": row.name
  	});
  });

	var valuesMappingSchema = {
        "type": 85,
        "name": "valueMappings",
        "label": "变量映射",
        "tooltip": "dataInputs",
        "defModel": {
            "enableRemove": true,
            "pagination": false,
            "columns": [{
                "editProps": {
                    "name": "key",
                    "label": "",
                    "type": 3,
                    "required": false,
                    "inputTip": "变量名",
                    "optionValues": optionValues
                },
                "dataIndex": "key",
                "title": "变量",
                "key": "key"            
            },{
                "editProps": {
                    "name": "toFieldPath",
                    "label": "",
                    "type": 3,
                    "required": false,
                    "inputTip": "JSONPath",
                    "optionValues": []
                },
                "dataIndex": "toFieldPath",
                "title": "映射变量路径",
                "key": "toFieldPath"
            }],
            "enableAdd": true,
            "enableEdit": true
        }
    };

  components.forEach(function(row){
      row.componentName =  row.typeId.split("ComponentName:")[1];
      row.componentType =  row.typeId.split("ComponentType:")[1].split(":")[0];
      row.globalParameterValues = globalParameterValues;
      row.valuesMappingSchema = JSON.stringify(valuesMappingSchema);
      var compTraits = traits[row.typeId];

      if(compTraits){
        compTraits.forEach(function(trait){
          trait.globalParameterValues = globalParameterValues;
          trait.valuesMappingSchema = JSON.stringify(valuesMappingSchema);
        });
        row.traitCnt = compTraits.length;
        row.traits = compTraits;
        row.traitNames = compTraits.map(function(row){return row.typeId.split("Trait:")[1]}).join(",");
      }else{
        row.traitCnt = 0;
        row.traits = [];
        row.traitNames = "";
      }
  })

  console.log(components);
